void LGDP4524_DelayCycles(uint32_t cycles)
{
	uint32_t i;
	for (i = 0; i < cycles; i++);
}

/*---------------Start uC dependent interfaces---------------*/

void SetLow(volatile void* selectedPort, uint32_t selectedPins)
{
	HAL_GPIO_WritePin((GPIO_TypeDef*)selectedPort, selectedPins, GPIO_PIN_RESET);
}


void SetHigh(volatile void* selectedPort, uint32_t selectedPins)
{
	HAL_GPIO_WritePin((GPIO_TypeDef*)selectedPort, selectedPins, GPIO_PIN_SET);
}

/*---------------End uC dependent interfaces---------------*/

#ifndef FSMC_IS_USED
void SetPinAsInput(volatile void* selectedPort, uint16_t selectedPin)
{
    *(selectedPort+1) &= ~selectedPin;
}

void SetPinAsOutput(volatile void* selectedPort, uint16_t selectedPin)
{
    *(selectedPort+1) |= selectedPin;
}

uint8_t GetPinValue(volatile void* selectedPort, uint16_t selectedPin){
    //return GPIO_getInputPinValue(selectedPort, selectedPins);
    uint8_t value;
    value = (*(selectedPort-1)) & selectedPin;
    if (value){
        return 1;
    }
    else
    {
        return 0;
    }
}

void ConfigPinsAsOutput(volatile void* selectedPort, uint16_t selectedPins){
    GPIO_setAsOutputPin(selectedPort, selectedPins);
}

void ConfigPinsAsInput(volatile void* selectedPort, uint16_t selectedPins){
    GPIO_setAsInputPinWithPullUpResistor(selectedPort, selectedPins);
}

void SetPin(volatile void* selectedPort, uint16_t selectedPin, uint8_t value)
{
    if (value)
    {
        SetHigh(selectedPort, selectedPin);
    }
    else
    {
        SetLow(selectedPort, selectedPin);
    }
}

#endif
