void LGDP4524_Delay_ms(uint16_t miliseconds)
{
    HAL_Delay(miliseconds);
}

inline void LGDP4524_Delay_micro(volatile uint16_t  microseconds)
{
    microseconds *= (SystemCoreClock/1000000)/5;
    while(microseconds--);
}

