#ifdef FSMC_IS_USED
void FSMC_Write_Cmd(uint16_t cmd)
{
	ADDR_CMD = 0;
	ADDR_CMD = (uint8_t)(cmd&0x00FF);
}

void FSMC_Write_Data(uint16_t data)
{
	ADDR_DATA = (uint8_t)(data>>8);
	ADDR_DATA = (uint8_t)(data&0x00FF);
}

uint16_t FSMC_Read_Data(void)
{
	uint16_t reg_val = 0;
	reg_val = ADDR_DATA<<8;
	reg_val |= ADDR_DATA;
	return reg_val;
}

#endif
